import React from 'react';
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import Table from 'react-bootstrap/Table';

function StatusCard(props) {

    const data = [
        { name: 'nodejs.12.4.rpm', value: "Success" },
        { name: 'git.1.5.3.rpm', value: "Success" },
        { name: 'java_1.8.0.el7.rpm', value: "Failed" },
        { name: 'reacharts.tar.gz', value: "Success" },
        { name: 'NexusUploaderShow.pptx', value: "Unknown" },
    ];

    return(
        <Container>
            <Row className="justify-content-md-center">
                <Col>
                <Card bg="dark" text="white" style={{"justify-content": 1}}>
                <Card.Header >Featured</Card.Header>
                <ListGroup variant="light">
                    {data.map((item) => 
                        <ListGroup.Item> {item.name}:   {item.value}</ListGroup.Item>
                    )}
                </ListGroup>
            </Card>
                </Col>
            </Row>
        </Container>
    );
}

export default StatusCard;
